// SPDX-License-Identifier: MIT

pragma solidity ^0.7.0;

import '@openzeppelin/contracts/math/Math.sol';
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import '@openzeppelin/contracts/token/ERC20/SafeERC20.sol';
import '@openzeppelin/contracts/token/ERC20/ERC20.sol';
import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/math/SafeMath.sol';
import './libraries/TransferHelper.sol';
import './libraries/TacoLibrary.sol';
import './interfaces/IUniswapV2Router01.sol';
import './interfaces/IUniswapV2Pair.sol';
import './interfaces/IUniswapV2Factory.sol';
import './interfaces/IPool.sol';
import './interfaces/IWETH.sol';
import './interfaces/IIndexFund.sol';


/// @author Kindynos
/// @title Helper Functions to buy funds.
contract TacoHelper {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    // WBNB || WETH address
    address public weth;

    // The DEX router and factory. From router you can get weth(wbnb) address and factory address
    IUniswapV2Router01 public uniRouter;
    IUniswapV2Factory public uniFactory;

    // The Factory used to get the fund addresses
    address public tacoFactory;

    modifier ensure(uint deadline) {
        require(deadline >= block.timestamp, 'Taco: EXPIRED');
        _;
    }

    /**
     * @notice Creates an Index Fund.
     * @param _uniRouter The DEX router used to trade tokens.
     * @param _tacoFactory The amounts of the respective tokens that represent a (1) unit of the Fund Token
     */
    constructor(
        IUniswapV2Router01 _uniRouter,
        address _tacoFactory
    ) {
        uniRouter = _uniRouter;
        weth = _uniRouter.WETH();
        uniFactory = IUniswapV2Factory(uniRouter.factory());
        tacoFactory = _tacoFactory;
    }

    // Internal function that wraps tokens.
    function _wrap(address fund, uint256 fundAmount, uint256[] memory amounts, address from, address to) internal returns(uint256) {
        IERC20[] memory tokens = IWrappedFund(fund).tokens();
        for(uint i = 0; i < tokens.length; i++){
            TransferHelper.safeTransferFrom(address(tokens[i]), from, fund, amounts[i]);
        }
        return IWrappedFund(fund).wrap(fundAmount, to);
    }

    /**
     * @notice Given ETH amount, estimate the min tokens amount[] to maximize fund acquisition.
     * @dev This is an expensive function if called from a transaction.
     * @param fund A valid fund address.
     * @param amountETH The ETH amount that will be used in the transaction.
     * @return The amounts for each token required.
     * @return The exact ETH amount expected to be spent.
     */
    function getAmountsInForETH(IWrappedFund fund, uint256 amountETH) public view returns(uint256[] memory, uint256) {
        // Get the unit prices for each token.
        uint256[] memory unitAmounts = fund.lastUnitPrices();
        IERC20[] memory tokens = fund.tokens();
        address[] memory path = new address[](2);
        uint256[] memory unitTokensWETH = new uint256[](tokens.length);
        uint256 totalETHValue;
        // Needed in an extra-loop because we need the WETH total value for an IFT.
        path[1] = weth;
        for(uint i = 0; i < tokens.length; i++){
            // Get the tokens value in ETH
            if(address(tokens[i]) == weth) {
                unitTokensWETH[i] = unitAmounts[i];
            }
            else{
                path[0] = address(tokens[i]);
                unitTokensWETH[i] = uniRouter.getAmountsOut(unitAmounts[i], path)[1];
            }
            totalETHValue = totalETHValue.add(unitTokensWETH[i]);
        }
        for(uint i = 0; i < tokens.length; i++) {
            uint256 proportionInWeth = amountETH.mul(unitTokensWETH[i]).div(totalETHValue);
            if (address(tokens[i]) == weth) {
                unitAmounts[i] = proportionInWeth;
                continue;
            }
            // Estimate how much we can buy of each coin
            path[0] = weth;
            path[1] = address(tokens[i]);
            unitAmounts[i] = uniRouter.getAmountsOut(proportionInWeth, path)[1];
            // amounts[i] = amountsOut[1];
        }
        // How much Fund could we get from those amounts
        uint256 fundAmount = IWrappedFund(fund).estimateAmountOut(unitAmounts);
        // Amounts needed to buy that fund (not necessarily the same as previous amounts)
        return (IWrappedFund(fund).estimateAmountIn(fundAmount), fundAmount);
    }

    /**
     * @notice Buys the amount of funds specified using ETH/BNB. Should be used with amounts from getAmountsInForETH or there could be leftovers.
     * @dev The ethAmount should include UPPER slippage.
     * @param _tokenArray The addresses that make the fund.
     * @param amounts Amounts of each token that the Helper will buy with the ETH/BNB. They should be in order.
     * @param fundAmount The min amount of IFT we expect to receive.
     * @param to The address that receives the funds.
     * @param deadline The block timestamp where this transaction will expire.
     */
    function buyFundETH(
        address[] memory _tokenArray,
        uint256[] memory amounts,
        uint256 fundAmount,
        address to, uint deadline)
    external payable ensure(deadline) {
        IWrappedFund fund = IWrappedFund(fundFor(_tokenArray));
        uint256 amountETH = 0;
        address[] memory path = new address[](2);
        IERC20[] memory tokens = fund.tokens();

        // buy coins needed
        for(uint i = 0; i < tokens.length; i++){
            if (address(tokens[i]) == weth) {
                IWETH(weth).deposit{value: amounts[i]}();
                tokens[i].safeTransfer(msg.sender, amounts[i]);
                amountETH = amountETH.add(amounts[i]);
                continue;
            }

            path[0] = weth;
            path[1] = address(tokens[i]);
            uint256[] memory amountsIn = uniRouter.getAmountsIn(amounts[i], path);
            uint256[] memory spent = uniRouter.swapETHForExactTokens{value:amountsIn[0]}(amounts[i], path, msg.sender, deadline);
            amountETH = amountETH.add(spent[0]);
        }
        // wrap funds
        uint256 funded = _wrap(address(fund), fundAmount, amounts, msg.sender, to);
        require(funded >= fundAmount);
        // refund dust eth, if any
        if (msg.value.sub(amountETH) > 0) TransferHelper.safeTransferETH(msg.sender, msg.value.sub(amountETH));
    }


    /**
     * @notice Buys most funds possible using amounts given.
     * @dev The fundMin should include slippage.
     * @param _tokenArray The addresses that make the fund.
     * @param fundMin The min amount of IFT we expect to receive.
     * @param amounts The amount of each token that we want to spend. Amounts should be in order.
     * @param to The address that receives the funds.
     * @param deadline The block timestamp where this transaction will expire.
     */
    function buyFund(address[] memory _tokenArray, uint256 fundMin, uint256[] memory amounts, address to, uint deadline) external payable ensure(deadline) {
        IWrappedFund fund = IWrappedFund(fundFor(_tokenArray));
        uint256 fundAmount = fund.estimateAmountOut(amounts);
        uint256[] memory realAmounts = fund.estimateAmountIn(fundAmount);

    uint256 funded =  _wrap(address(fund), fundAmount, realAmounts, msg.sender, to);
        require(funded >= fundMin);
    }



    /**
     * @notice Sells the fund token for underlying.
     * @dev amountsMin should include slippage of at least 0.001
     * @param _tokenArray The addresses that make the fund.
     * @param amountFund Amount of fund token we wank to sell.
     * @param amountsMin The min amount of tokens we expect to receive. Should be in order.
     * @param to The address that receives the funds.
     * @param deadline The block timestamp where this transaction will expire.
     */
    function sellFund(address[] memory _tokenArray, uint256 amountFund, uint256[] memory amountsMin, address to, uint deadline) external payable ensure(deadline) {
        address fund = fundFor(_tokenArray);
        TransferHelper.safeTransferFrom(fund, msg.sender, fund, amountFund);
        uint256[] memory amounts = IWrappedFund(fund).unwrap(to);
        IERC20[] memory tokens = IWrappedFund(fund).tokens();
        for(uint i = 0; i < tokens.length; i++){
            require(amounts[i] >= amountsMin[i] , "INSUFFICIENT OUTPUT AMOUNT");
        }
    }

    // **** LIBRARY FUNCTIONS ****

    /// Calculates the CREATE2 address for a fund without making any external calls
    function fundFor(address[] memory _tokenArray)
    public
    view
    virtual
    returns (address fund)
    {
        return TacoLibrary.fundFor(tacoFactory, _tokenArray);
    }

    /// Estimate maximum possible amount of fund minted for amounts. Assumes correct order
    function getAmountOut(address[] memory _tokenArray, uint256[] memory _amountsIn) public view returns(uint256 amountOut){
        return TacoLibrary.getAmountOut(tacoFactory, _tokenArray, _amountsIn);
    }

    /// Estimate minimum amounts needed to mint exact fund amount.
    function getAmountIn(address[] memory _tokenArray, uint256 amountOut) public view returns(uint256[] memory amounts) {
        return TacoLibrary.getAmountIn(tacoFactory, _tokenArray, amountOut);
    }

    /// Sort token arrays to get the order used in the Controller and Fund.
    function sortTokens(address[] memory _tokenArray) public view returns(address[] memory) {
        return TacoLibrary.sortTokens(_tokenArray);
    }

}

